import React from 'react';

function Introduction() {
  return (
    <section className="introduction p-4">
      <h1 className="text-3xl font-bold">INTRODUCTION</h1>
      <h1>GLOOM DEV is a dynamic startup specializing in Data Science, IoT, AI, and Machine Learning solutions. 
        Our institution is accredited by AICTE for excellence in technical education and recognized by MSME for its contributions to the growth of small and medium enterprises.
         Our mission is to empower businesses and individuals through innovative technologies and 
         comprehensive training programs. We focus on delivering bespoke solutions that foster digital transformation and practical skill development. At GLOOM DEV, we are committed to making a significant impact in the 
         tech industry by providing customized and impactful solutions.</h1>
    </section>
  );
}

export default Introduction;
